import{_ as l}from"./plugin-vue_export-helper.21dcd24c.js";import{o as i,c as a,d as e}from"./app.d6b42b88.js";const o={},r=e('<blockquote><p>The limits of my language mean the limits of my world.</p></blockquote><h2 id="\u1100\u1162\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#\u1100\u1162\u110B\u116D" aria-hidden="true">#</a> \uAC1C\uC694</h2><p>\uB300\uBD80\uBD84\uC758 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC740 \uD558\uB098\uC758 \uB370\uC774\uD130 \uBAA8\uB378\uC744 \uB2E4\uB978 \uB370\uC774\uD130 \uBAA8\uB378 \uC704\uC5D0 \uACC4\uCE35\uC744 \uB46C\uC11C \uB9CC\uB4E0\uB2E4. \uAC01 \uACC4\uCE35\uC758 \uD575\uC2EC\uC801\uC778 \uBB38\uC81C\uB294 \uB2E4\uC74C \uD558\uC704 \uACC4\uCE35 \uAD00\uC810\uC5D0\uC11C \uB370\uC774\uD130 \uBAA8\uB378\uC744 \uD45C\uD604\uD558\uB294 \uBC29\uBC95\uC774\uB2E4.</p><ul><li>\uC560\uD50C\uB9AC\uCF00\uC774\uC158 \uAC1C\uBC1C\uC790\uB294 \uD604\uC2E4\uC744 \uBCF4\uACE0 \uAC1D\uCCB4\uB098 \uB370\uC774\uD130 \uAD6C\uC870 \uB610\uD55C \uC774\uB7EC\uD55C \uB370\uC774\uD130 \uAD6C\uC870\uB97C \uB2E4\uB8E8\uB294 API\uB97C \uBAA8\uB378\uB9C1\uD55C\uB2E4.</li><li>\uB370\uC774\uD130 \uAD6C\uC870\uB97C \uC800\uC7A5\uD560 \uB54C\uB294 JSON, \uAD00\uACC4\uD615 \uB370\uC774\uD130\uBCA0\uC774\uC2A4 \uD14C\uC774\uBE14 \uD639\uC740 \uADF8\uB798\uD504 \uBAA8\uB378 \uAC19\uC740 \uBC94\uC6A9 \uB370\uC774\uD130 \uBAA8\uB378(general data model)\uB85C \uD45C\uD604\uD55C\uB2E4.</li><li>\uB370\uC774\uD130\uBCA0\uC774\uC2A4 \uC18C\uD504\uD2B8\uC6E8\uC5B4\uB97C \uAC1C\uBC1C\uD558\uB294 \uC5D4\uC9C0\uB2C8\uC5B4\uB294 general-purpose data\uB97C \uBA54\uBAA8\uB9AC\uB098 \uB514\uC2A4\uD06C \uB610\uB294 \uB124\uD2B8\uC6CC\uD06C \uC0C1\uC704 \uBC14\uC774\uD2B8 \uB2E8\uC704\uB85C \uD45C\uD604\uD558\uB294 \uBC29\uBC95\uC744 \uACB0\uC815\uD55C\uB2E4.</li><li>\uB354 \uB0AE\uC740 \uAD00\uC810\uC5D0\uC11C \uBCF4\uBA74 \uD558\uB4DC\uC6E8\uC5B4 \uC5D4\uC9C0\uB2C8\uC5B4\uB294 \uC804\uB958, \uBE5B\uC758 \uD30C\uB3D9 \uC790\uAE30\uC7A5 \uB4F1\uC758 \uAD00\uC810\uC5D0\uC11C \uBC14\uC774\uD2B8\uB97C \uD45C\uD604\uD55C\uB2E4.</li></ul><p>\uBCF4\uB2E4\uC2DC\uD53C \uAC01 \uACC4\uCE35\uC740 \uBA85\uD655\uD55C \uB370\uC774\uD130 \uBAA8\uB378\uC744 \uC81C\uACF5\uD574 \uD558\uC704 \uACC4\uCE35\uC758 \uBCF5\uC7A1\uC131\uC744 \uC228\uAE34\uB2E4. \uC774 \uCD94\uC0C1\uD654\uB294 \uB2E4\uB978 \uADF8\uB8F9\uC5D0\uC11C \uC77C\uC744 \uD558\uB294 \uC0AC\uB78C\uB4E4\uC774 (\uC608\uB97C \uB4E4\uC5B4 \uB370\uC774\uD130 \uBCA0\uC774\uC2A4 \uC5D4\uC9C0\uB2C8\uC5B4\uC640 \uC560\uD50C\uB9AC\uCF00\uC774\uC158 \uAC1C\uBC1C\uC790) \uD6A8\uC728\uC801\uC73C\uB85C \uD568\uAED8 \uC77C \uD560 \uC218 \uC788\uAC8C\uB054 \uD55C\uB2E4.</p><p>\uB370\uC774\uD130 \uBAA8\uB378\uC740 \uC18C\uD504\uD2B8\uC6E8\uC5B4\uAC00 \uC5B4\uB5BB\uAC8C \uC791\uC131\uB410\uB294\uC9C0 \uBFD0\uB9CC \uC544\uB2C8\uB77C \uD574\uACB0\uD558\uB824\uB294 \uBB38\uC81C\uB97C \uC5B4\uB5BB\uAC8C \uC0DD\uAC01\uD574\uC57C \uD558\uB294\uC9C0, <strong>\uADF8 \uC704\uC5D0\uC11C \uC18C\uD504\uD2B8\uC6E8\uC5B4\uAC00 \uD560 \uC218 \uC788\uB294 \uC77C\uACFC \uD560 \uC218 \uC5C6\uB294 \uC77C\uC5D0 \uC9C0\uB300\uD55C \uC601\uD5A5\uC744 \uC8FC\uBBC0\uB85C \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC5D0 \uC801\uD569\uD55C \uB370\uC774\uD130 \uBAA8\uB378\uC744 \uC120\uD0DD\uD558\uB294 \uC791\uC5C5\uC740 \uC0C1\uB2F9\uD788 \uC911\uC694\uD558\uB2E4.</strong></p><p>\uC774 \uC7A5\uC5D0\uC11C\uB294 \uB2E4\uC591\uD55C \uBC94\uC6A9 \uB370\uC774\uD130 \uBAA8\uB378(general data model) \uC911\uC5D0\uC11C\uB3C4 \uAD00\uACC4\uD615 \uBAA8\uB378, \uBB38\uC11C \uBAA8\uB378, \uADF8\uB798\uD504 \uAE30\uBC18 \uB370\uC774\uD130 \uBAA8\uB378\uC5D0 \uC911\uC810\uC744 \uB450\uACE0 \uC0B4\uD3B4\uBCF8\uB2E4. \uAC01 \uB370\uC774\uD130 \uBAA8\uB378\uC744 \uD2B9\uC9D5, \uC0AC\uC6A9\uD558\uB294 \uC774\uC720\uC640 \uC5BB\uC744 \uC218 \uC788\uB294 \uC774\uC810\uC744 \uBA85\uD655\uD788 \uC54C\uC544\uC57C \uC6B0\uB9AC\uAC00 \uB9CC\uB4E4\uB824\uB294 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC5D0 \uB9DE\uCDB0\uC11C \uC120\uD0DD\uD560 \uC218 \uC788\uB2E4.</p><h2 id="\u1100\u116A\u11AB\u1100\u1168\u1112\u1167\u11BC-\u1106\u1169\u1103\u1166\u11AF" tabindex="-1"><a class="header-anchor" href="#\u1100\u116A\u11AB\u1100\u1168\u1112\u1167\u11BC-\u1106\u1169\u1103\u1166\u11AF" aria-hidden="true">#</a> \uAD00\uACC4\uD615 \uBAA8\uB378</h2><ul><li>\uC624\uB298\uB0A0 \uAC00\uC7A5 \uC798 \uC54C\uB824\uC9C4 \uBAA8\uB378\uC740 \uAD00\uACC4\uD615 \uBAA8\uB378\uC744 \uAE30\uBC18\uC73C\uB85C \uD55C SQL\uC774\uB2E4.</li><li>\uB370\uC774\uD130(SQL\uC5D0\uC11C \uD14C\uC774\uBE14\uC774\uB77C\uACE0 \uBD88\uB9B0\uB2E4) \uAD00\uACC4(relation)\uB85C \uAD6C\uC131\uB418\uACE0 \uAC01 \uAD00\uACC4\uB294 \uC21C\uC11C \uC5C6\uB294 \uD29C\uD50C(tuple \uD639\uC740 row)\uC758 \uBAA8\uC74C\uC774\uB2E4.</li><li>\uAD00\uACC4\uD615 \uB370\uC774\uD130\uBCA0\uC774\uC2A4\uC758 \uADFC\uC6D0\uC740 1960-1970\uB144\uB300 \uBA54\uC778\uD504\uB808\uC784\uC5D0\uC11C \uC218\uD589\uB41C \uBE44\uC988\uB2C8\uC2A4 \uB370\uC774\uD130 \uCC98\uB9AC\uC5D0 \uC788\uB2E4. <ul><li>\uD2B8\uB79C\uC7AD\uC158 \uCC98\uB9AC(\uC740\uD589 \uAC70\uB798, \uD56D\uACF5 \uC608\uC57D, \uCC3D\uACE0 \uC7AC\uACE0 \uBCF4\uAD00)</li><li>\uC77C\uAD04\uCC98\uB9AC(\uC1A1\uC7A5 \uC791\uC131, \uAE09\uC5EC \uC9C0\uBD88, \uBCF4\uACE0)</li></ul></li><li>\uB2F9\uC2DC \uB2E4\uB978 \uB370\uC774\uD130\uBCA0\uC774\uC2A4\uB97C \uC0AC\uC6A9\uD558\uB294 \uC560\uD50C\uB9AC\uCF00\uC774\uC158 \uAC1C\uBC1C\uC790\uB294 \uB370\uC774\uD130\uBCA0\uC774\uC2A4\uC758 \uB0B4\uBD80 \uB370\uC774\uD130 \uD45C\uD604\uC5D0 \uB300\uD574 \uB9CE\uC774 \uACE0\uBBFC\uD574\uC57C \uD588\uC9C0\uB9CC \uAD00\uACC4\uD615 \uBAA8\uB378\uC758 \uBAA9\uD45C\uB294 \uC815\uB9AC\uB41C \uC778\uD130\uD398\uC774\uC2A4 \uB4A4\uB85C \uAD6C\uD604 \uC138\uBD80 \uC0AC\uD56D\uC744 \uC228\uAE30\uB294 \uAC83\uC774\uB2E4.</li></ul><h2 id="nosql" tabindex="-1"><a class="header-anchor" href="#nosql" aria-hidden="true">#</a> NoSQL</h2><p>Not Only SQL\uB85C \uD574\uC11D\uB41C\uB2E4. NoSQL DB\uB97C \uCC44\uD0DD\uD55C \uB370\uB294 \uB2E4\uC74C\uACFC \uAC19\uC740 \uC6D0\uB3D9\uB825\uC774 \uC788\uB2E4.</p><ul><li>\uB300\uADDC\uBAA8 \uB370\uC774\uD130\uC14B\uC774\uB098 \uB9E4\uC6B0 \uB192\uC740 \uC4F0\uAE30 \uCC98\uB9AC\uB7C9 \uB2EC\uC131\uC5D0 \uB300\uD574 RDB\uBCF4\uB2E4 \uB354 \uB6F0\uC5B4\uB09C \uD655\uC7A5\uC131\uC774 \uD544\uC694(Scalability)</li><li>\uC624\uD508\uC18C\uC2A4\uC5D0 \uB300\uD55C \uC120\uD638\uB3C4 \uD655\uC0B0</li><li>\uAD00\uACC4\uD615 \uBAA8\uB378\uC5D0\uC11C \uC9C0\uC6D0\uD558\uC9C0 \uC54A\uB294 \uD2B9\uC131\uD654\uB41C \uC9C8\uC758 \uB3D9\uC791</li><li>\uAD00\uACC4\uD615 \uC2A4\uD0A4\uB9C8\uC758 \uC81C\uD55C\uC5D0 \uB300\uD55C \uBD88\uB9CC, \uB354 \uB3D9\uC801\uC774\uACE0 \uD48D\uBD80\uD574\uC9C4 \uB370\uC774\uD130 \uBAA8\uB378\uC5D0 \uB300\uD55C \uBC14\uB78C</li><li>NoSQL\uC758 \uB300\uD45C\uC801\uC778 \uBAA8\uB378 <ul><li>\uBB38\uC11C DB : \uBB38\uC11C\uC640 \uBB38\uC11C \uAC04 \uAD00\uACC4\uAC00 \uAC70\uC758 \uC5C6\uB294 \uACBD\uC6B0\uB97C \uB300\uC0C1\uC73C\uB85C \uD55C\uB2E4.</li><li>\uADF8\uB798\uD504 DB : \uBAA8\uB4E0 \uC790\uB8CC\uAC00 \uC7A0\uC7AC\uC801\uC73C\uB85C \uAD00\uB828 \uC788\uB294 \uACBD\uC6B0\uB97C \uB300\uC0C1\uC73C\uB85C \uD55C\uB2E4.</li></ul></li></ul><h2 id="nosql-\u1106\u116E\u11AB\u1109\u1165\u1106\u1169\u1103\u1166\u11AF" tabindex="-1"><a class="header-anchor" href="#nosql-\u1106\u116E\u11AB\u1109\u1165\u1106\u1169\u1103\u1166\u11AF" aria-hidden="true">#</a> NoSQL : \uBB38\uC11C\uBAA8\uB378</h2><p>\uB204\uAD70\uAC00\uC758 \uC774\uB825\uC11C \uD504\uB85C\uD544\uC744 \uC608\uC2DC\uB85C \uB4E0\uB2E4\uBA74. \uC77C\uBC18\uC801\uC778 \uC774\uB825\uC11C\uB294 \uC774\uB825\uC774 \uD558\uB098 \uC774\uC0C1\uC774\uBA70 \uD559\uB825\uACFC \uC5F0\uB77D\uCC98 \uC815\uBCF4\uB3C4 \uB2E4\uC591\uD560 \uC218 \uC788\uB2E4. \uC0AC\uC6A9\uC790\uC640 \uD56D\uBAA9\uC740 \uC77C\uB300\uB2E4(one-to-many) \uAD00\uACC4\uC774\uB2E4. \uC774\uB7F0 \uAD00\uACC4\uB97C \uC804\uD1B5\uC801\uC778 \uBC29\uBC95\uC73C\uB85C RDB\uB97C \uC124\uACC4\uD558\uBA74 \uC815\uADDC\uD654 \uD45C\uD604\uC73C\uB85C \uC9C1\uC704, \uD559\uC704, \uD559\uB825, \uC5F0\uB77D\uCC98 \uC815\uBCF4\uB97C \uAC1C\uBCC4 \uD14C\uC774\uBE14\uC5D0 \uC800\uC7A5\uD558\uACE0 \uC678\uB798 \uD0A4\uB97C \uC774\uC6A9\uD574 user \uD14C\uC774\uBE14\uC744 \uCC38\uC870\uD560 \uC218 \uC788\uB2E4. \uADF8\uB7EC\uB098 \uC774\uB825\uC11C\uB294 \uBAA8\uB4E0 \uB0B4\uC6A9\uC744 \uAC16\uCD94\uACE0 \uC788\uB294 \uBB38\uC11C \uC774\uAE30 \uB54C\uBB38\uC5D0 JSON\uC774 \uD45C\uD604\uC5D0 \uC801\uD569\uD558\uB2E4. \uBABD\uACE0 DB \uCE74\uC6B0\uCE58 DB \uB4F1\uC758 \uBB38\uC11C \uC9C0\uD5A5 \uB370\uC774\uD130 \uBCA0\uC774\uC2A4\uC5D0\uC11C Json \uB370\uC774\uD130 \uBAA8\uB378\uC744 \uC9C0\uC6D0\uD55C\uB2E4.</p><ul><li>JSON \uD45C\uD604\uC740 multi-table \uC2A4\uD0A4\uB9C8\uBCF4\uB2E4 \uB354 \uB098\uC740 \uC9C0\uC5ED\uC131(locality)\uC744 \uAC16\uB294\uB2E4.</li><li>\uB2E4\uC911 \uC9C8\uC758 \uC218\uD589\uD558\uAC70\uB098 \uB2E4\uC911 \uC870\uC778\uC774 \uD544\uC694 \uC5C6\uB2E4. \uBAA8\uB4E0 \uAD00\uB828 \uC815\uBCF4\uAC00 \uD55C \uACF3\uC5D0 \uC788\uC5B4 \uC9C8\uC758 \uD558\uB098\uB85C \uCDA9\uBD84\uD558\uB2E4.</li><li>\uC77C\uB300\uB2E4 \uAD00\uACC4\uB294 \uC758\uBBF8\uC0C1 \uB370\uC774\uD130 \uD2B8\uB9AC \uAD6C\uC870\uC640 \uAC19\uB2E4.</li></ul><div class="custom-container info"><p class="custom-container-title">\uB2E4\uB300\uC77C\uACFC \uB2E4\uB300\uB2E4 \uAD00\uACC4</p><p>\uB9CC\uC57D \uC774\uB825\uC11C\uC5D0\uC11C \uC9C0\uC5ED\uC5D0 \uB300\uD55C \uC815\uBCF4\uAC00 \uB4E4\uC5B4\uAC04\uB2E4\uBA74 \uC774 \uACBD\uC6B0\uB294 \uBCF4\uD1B5 \uBB38\uC790\uB85C \uBC1B\uC9C0 \uC54A\uACE0 region_id\uCC98\uB7FC ID\uB85C \uC8FC\uC5B4\uC9C4\uB2E4. \uC774\uB807\uAC8C id\uAC00 \uC8FC\uC5B4\uC9C0\uB294 \uC774\uC720\uB294 \uC544\uB798\uC640 \uAC19\uC740 \uC7A5\uC810\uC774 \uC788\uB2E4.</p><ul><li>\uC77C\uAD00\uB41C \uC2A4\uD0C0\uC77C\uACFC \uCCA0\uC790</li><li>\uBAA8\uD638\uD568 \uD68C\uD53C(\uC11C\uC6B8, \uC11C\uC6B8\uC2DC, \uC11C\uC6B8\uD2B9\uBCC4\uC2DC\uC640 \uAC19\uC740 \uB2E8\uC5B4\uB97C \uC815\uC81C\uD558\uC5EC \uC0AC\uC6A9)</li><li>\uAC31\uC2E0\uC758 \uD3B8\uC758\uC131</li><li>\uD604\uC9C0\uD654 \uC9C0\uC6D0, \uD45C\uC900 \uBAA9\uB85D\uC744 \uD604\uC9C0\uD654\uD558\uC5EC \uC9C0\uC5ED\uACFC \uC5C5\uACC4\uB97C \uC0AC\uC774\uD2B8\uB97C \uBCF4\uB294 \uC0AC\uB78C\uC758 \uC5B8\uC5B4\uB85C \uD45C\uC2DC</li><li>\uB354 \uB098\uC740 \uAC80\uC0C9 \uC81C\uACF5(\uC6CC\uC2F1\uD134 \uC8FC\uC5D0 \uC788\uB294 \uC790\uC120\uAC00)</li></ul><p>\uC911\uBCF5\uC758 \uBB38\uC81C: Id\uB97C \uC0AC\uC6A9\uD558\uBA74 \uC815\uBCF4\uB97C \uD55C \uACF3\uC5D0\uB9CC \uC800\uC7A5\uD558\uACE0 \uD574\uB2F9 Id\uB97C \uC0AC\uC6A9\uD558\uBA74 \uB418\uC9C0\uB9CC, \uD14D\uC2A4\uD2B8\uB85C \uC800\uC7A5\uD558\uBA74 \uBAA8\uB4E0 \uB808\uCF54\uB4DC\uC5D0 \uC911\uBCF5\uC774 \uBC1C\uC0DD\uD55C\uB2E4. \uB9CC\uC57D \uC815\uBCF4\uAC00 \uC911\uBCF5\uB418\uC5B4\uC788\uC73C\uBA74 \uBCC0\uACBD\uC0AC\uD56D \uBC1C\uC0DD \uC2DC \uBAA8\uB4E0 \uC911\uBCF5\uD56D\uBAA9\uC744 \uBCC0\uACBD\uD574\uC57C \uD558\uBBC0\uB85C \uC4F0\uAE30 \uC624\uBC84\uD5E4\uB4DC\uC640 \uBD88\uC77C\uCE58 \uC704\uD5D8\uC774 \uC788\uB2E4.</p><p>\uC774\uCC98\uB7FC <strong>\uC911\uBCF5\uB41C \uB370\uC774\uD130\uB97C \uC815\uADDC\uD654\uD558\uB824\uBA74 \uB2E4\uB300\uC77C(many-to-one) \uAD00\uACC4\uAC00 \uD544\uC694\uD558\uC9C0\uB9CC \uBB38\uC11C \uBAA8\uB378\uC5D0\uB294 \uC801\uD569\uD558\uC9C0 \uC54A\uB2E4. \uC870\uC778\uC5D0 \uB300\uD55C \uC9C0\uC6D0\uC774 \uC57D\uD558\uAE30 \uB54C\uBB38\uC774\uB2E4.</strong></p></div><h2 id="nosql-\u1100\u1173\u1105\u1162\u1111\u1173-\u1106\u1169\u1103\u1166\u11AF" tabindex="-1"><a class="header-anchor" href="#nosql-\u1100\u1173\u1105\u1162\u1111\u1173-\u1106\u1169\u1103\u1166\u11AF" aria-hidden="true">#</a> NoSQL : \uADF8\uB798\uD504 \uBAA8\uB378</h2><p>\uAD00\uACC4\uD615 \uBAA8\uB378 \uB610\uD55C \uB2E4\uB300\uB2E4 \uAD00\uACC4\uB97C \uB2E4\uB8E8\uC9C0\uB9CC, \uB370\uC774\uD130 \uAC04 \uC5F0\uACB0\uC774 \uB354 \uBCF5\uC7A1\uD574\uC9C0\uBA74 \uADF8\uB798\uD504\uB85C \uB370\uC774\uD130\uB97C \uBAA8\uB378\uB9C1\uD558\uB294 \uCABD\uC774 \uB354 \uC790\uC5F0\uC2A4\uB7EC\uC6B8 \uC218 \uC788\uB2E4. \uBAA8\uB4E0 \uB370\uC774\uD130\uAC00 \uC7A0\uC7AC\uC801\uC73C\uB85C \uAD00\uB828 \uC788\uB294 \uB370\uC774\uD130\uB97C \uB2E4\uB8E8\uB294 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC5D0 \uC801\uD569\uD558\uB2E4.</p><p>\uADF8\uB798\uD504\uC758 \uAD6C\uC131 \uC694\uC18C\uB294 \uC815\uC810(vertex)\uACFC \uAC04\uC120(edge) \uB450 \uAC1D\uCCB4\uB85C \uC774\uB8E8\uC5B4\uC838 \uC788\uB2E4.</p><p>\uC77C\uBC18\uC801\uC778 \uADF8\uB798\uD504 \uBAA8\uB378\uB9C1\uC758 \uC608</p><ul><li><p>\uC18C\uC15C \uADF8\uB798\uD504</p><ul><li>\uC815\uC810: \uC0AC\uB78C</li><li>\uAC04\uC120: \uC0AC\uB78C\uB4E4\uC774 \uC11C\uB85C \uC54C\uACE0 \uC788\uC74C</li></ul></li></ul><ul><li><p>\uC6F9 \uADF8\uB798\uD504</p><ul><li>\uC815\uC810: \uC6F9 \uD398\uC774\uC9C0</li><li>\uAC04\uC120: \uB2E4\uB978 \uD398\uC774\uC9C0\uC5D0 \uB300\uD55C HTML \uB9C1\uD06C</li></ul></li></ul><ul><li>\uB3C4\uB85C\uB098 \uCCA0\uB3C4 \uB124\uD2B8\uC6CC\uD06C <ul><li>\uC815\uC810: \uAD50\uCC28\uB85C</li><li>\uAC04\uC120: \uB3C4\uB85C/\uCCA0\uB85C \uC120 \uB4F1</li></ul></li></ul><p>\uADF8\uB798\uD504\uB294 \uC704\uC758 \uC608\uC2DC\uC640 \uADF8\uB798\uD504\uC758 \uC815\uC810\uC774 \uAC19\uC774 \uBAA8\uB450 \uAC19\uC740 \uC720\uD615\uC744 \uB098\uD0C0\uB0B4\uC9C0\uB294 \uC54A\uB294\uB2E4. \uB2E4\uB978 \uC5EC\uB7EC \uC720\uD615\uC758 \uC815\uC810\uACFC \uAC04\uC120\uC744 \uB2E8\uC77C \uADF8\uB798\uD504\uB85C \uB098\uD0C0\uB0B4\uAE30\uB3C4 \uD55C\uB2E4.</p><ul><li>ex. \uD398\uC774\uC2A4\uBD81 <ul><li>\uC815\uC810: \uC0AC\uB78C, \uC7A5\uC18C, \uC774\uBCA4\uD2B8, \uCCB4\uD06C\uC778, \uCF54\uBA58\uD2B8</li><li>\uAC04\uC120: \uC5B4\uB5A4 \uC0AC\uB78C\uB4E4\uC774 \uC11C\uB85C \uCE5C\uAD6C\uC778\uAC00?</li><li>\uAC04\uC120: \uC5B4\uB5A4 \uC0AC\uB78C\uC774 \uC5B4\uB5A4 \uC704\uCE58\uC5D0\uC11C \uCCB4\uD06C\uC778\uD588\uB294\uAC00?</li><li>\uAC04\uC120: \uC5B4\uB5A4 \uC0AC\uB78C\uC774 \uC5B4\uB5A4 \uD3EC\uC2A4\uD2B8\uC5D0 \uC88B\uC544\uC694\uB97C \uB20C\uB800\uB294\uAC00?</li><li>\uAC04\uC120: \uC5B4\uB5A4 \uC0AC\uB78C\uC774 \uC5B4\uB5A4 \uD3EC\uC2A4\uD2B8\uC5D0 \uCF54\uBA58\uD2B8\uB97C \uC791\uC131\uD588\uB294\uAC00?</li><li>\uAC04\uC120: \uC5B4\uB5A4 \uC0AC\uB78C\uC774 \uC774\uBCA4\uD2B8\uC5D0 \uCC38\uC5EC\uD588\uB294\uAC00?</li></ul></li></ul><h2 id="\u1100\u1161\u11A8-\u1103\u1166\u110B\u1175\u1110\u1165-\u1106\u1169\u1103\u1166\u11AF\u110B\u1174-\u1107\u1175\u1100\u116D" tabindex="-1"><a class="header-anchor" href="#\u1100\u1161\u11A8-\u1103\u1166\u110B\u1175\u1110\u1165-\u1106\u1169\u1103\u1166\u11AF\u110B\u1174-\u1107\u1175\u1100\u116D" aria-hidden="true">#</a> \uAC01 \uB370\uC774\uD130 \uBAA8\uB378\uC758 \uBE44\uAD50</h2><p>\uBB38\uC11C \uB370\uC774\uD130 \uBAA8\uB378\uC744 \uC120\uD638\uD558\uB294 \uC8FC\uC694 \uC774\uC720\uB294 \uC2A4\uD0A4\uB9C8 \uC720\uC5F0\uC131, \uC9C0\uC5ED\uC131\uC5D0 \uAE30\uC778\uD55C \uB354 \uB098\uC740 \uC131\uB2A5 \uB54C\uBB38\uC774\uACE0, \uC77C\uBD80 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC758 \uACBD\uC6B0 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC5D0\uC11C \uC0AC\uC6A9\uD558\uB294 \uB370\uC774\uD130 \uAD6C\uC870\uC640 \uB354 \uAC00\uAE5D\uAE30 \uB54C\uBB38\uC774\uB2E4(\uC77C\uB300\uB2E4 \uAD00\uACC4) \uAD00\uACC4\uD615 \uBAA8\uB378\uC740 \uC870\uC778, \uB2E4\uB300\uC77C, \uB2E4\uB300\uB2E4 \uAD00\uACC4\uB97C \uB354 \uC798 \uC9C0\uC6D0\uD55C\uB2E4.</p><p>\uB9CC\uC57D \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC758 \uB370\uC774\uD130\uAC00 \uC774\uB825\uC11C\uC640 \uAC19\uC774 \uBB38\uC11C\uC640 \uBE44\uC2B7\uD55C \uAD6C\uC870 \uC989 \uC77C\uB300\uB2E4 \uD2B8\uB9AC \uAD00\uACC4\uB85C \uD55C \uBC88\uC5D0 \uC804\uCCB4 \uD2B8\uB9AC\uB97C \uC801\uC7AC\uD560 \uC218 \uC788\uB294 \uACBD\uC6B0\uB77C\uBA74 \uBB38\uC11C \uBAA8\uB378\uC744 \uC774\uC6A9\uD558\uB294 \uAC83\uC774 \uC88B\uB2E4. \uC774 \uACBD\uC6B0 \uAD00\uACC4\uD615 \uBAA8\uB378\uC744 \uC0AC\uC6A9\uD560 \uACBD\uC6B0 \uD14C\uC774\uBE14\uC744 \uBD84\uB9AC\uD558\uAC8C \uB418\uBA74\uC11C \uBD88\uD544\uC694\uD558\uAC8C \uBCF5\uC7A1\uD55C \uC560\uD50C\uB9AC\uCF00\uC774\uC158 \uCF54\uB4DC\uB97C \uBC1C\uC0DD\uC2DC\uD0A4\uAC8C \uB41C\uB2E4.</p><p>\uBB38\uC11C \uB370\uC774\uD130 \uBCA0\uC774\uC2A4\uB294 \uB0B4 \uC911\uCCA9 \uD56D\uBAA9\uC744 \uBC14\uB85C \uCC38\uC870\uD560 \uC218 \uC5C6\uB2E4\uB294 \uBB38\uC81C\uB97C \uAC00\uC9C0\uACE0 \uC788\uC9C0\uB9CC \uB108\uBB34 \uAE4A\uAC8C \uC911\uCCA9\uB418\uC9C0 \uC54A\uC73C\uBA74 \uC77C\uBC18\uC801\uC73C\uB85C \uBB38\uC81C\uAC00 \uB418\uC9C0 \uC54A\uB294\uB2E4.</p><p>\uBB38\uC11C \uB370\uC774\uD130 \uBCA0\uC774\uC2A4\uC758 \uBBF8\uD761\uD55C \uC870\uC778 \uC870\uAC74\uC740 \uBB38\uC81C\uC77C \uC218\uB3C4 \uC544\uB2D0 \uC218\uB3C4 \uC788\uB2E4. \uC5B4\uB5A4 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC5D0\uC11C \uC0AC\uC6A9\uD558\uB290\uB0D0\uC758 \uBB38\uC81C\uC778\uB370 \uC608\uB97C \uB4E4\uC5B4 \uC5B4\uB5A4 \uC2DC\uC810\uC5D0 \uBC1C\uC0DD\uD55C \uC774\uBCA4\uD2B8\uB97C \uAE30\uB85D\uD558\uB294 \uBD84\uC11D \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC740 \uB2E4\uB300\uB2E4 \uAD00\uACC4\uAC00 \uACB0\uCF54 \uD544\uC694\uD558\uC9C0 \uC54A\uB2E4. \uBB38\uC11C \uB370\uC774\uD130 \uBCA0\uC774\uC2A4\uB97C \uC0AC\uC6A9\uD558\uB294 \uAC83\uC774 \uC801\uD569\uD558\uB2E4.</p><p>\uD558\uC9C0\uB9CC \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC5D0\uC11C \uB2E4\uB300\uB2E4 \uAD00\uACC4\uB97C \uC0AC\uC6A9\uD55C\uB2E4\uBA74 \uBB38\uC11C \uBAA8\uB378\uBCF4\uB2E4 \uAD00\uACC4\uD615 \uB370\uC774\uD130\uBCA0\uC774\uC2A4\uAC00 \uB0AB\uB2E4.</p><p><strong>\uC560\uD50C\uB9AC\uCF00\uC774\uC158 \uB0B4\uC5D0\uC11C \uC870\uC778\uC744 \uB300\uCCB4\uD560 \uB2E4\uC911 \uC694\uCCAD\uC744 \uB9CC\uB4E4\uC5B4 \uB0BC \uC218 \uC788\uAE30\uB294 \uD558\uC9C0\uB9CC \uBCF5\uC7A1\uC131\uC774 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC73C\uB85C \uC774\uB3D9\uB420 \uBFD0 \uC544\uB2C8\uB77C \uB370\uC774\uD130 \uBCA0\uC774\uC2A4 \uB0B4 \uD2B9\uD654\uB41C \uCF54\uB4DC\uB85C \uC218\uD589\uB418\uB294 \uC870\uC778\uBCF4\uB2E4 \uB290\uB9AC\uB2E4.</strong></p><p>\uC77C\uBC18\uC801\uC73C\uB85C \uC5B4\uB5A4 \uB370\uC774\uD130 \uBAA8\uB378\uC774 \uC560\uD50C\uB9AC\uCF00\uC774\uC158 \uCF54\uB4DC\uB97C \uB354 \uAC04\uB2E8\uD558\uAC8C \uB9CC\uB4E4 \uC218 \uC788\uB294\uAC00\uC5D0 \uB300\uD55C \uB2F5\uC740 \uC5C6\uB2E4. \uB370\uC774\uD130 \uD56D\uBAA9 \uAC04\uC5D0 \uC874\uC7AC\uD558\uB294 \uAD00\uACC4 \uC720\uD615\uC5D0 \uB530\uB77C \uB2E4\uB974\uB2E4. \uC0C1\uD638\uC5F0\uACB0\uC774 \uB9CE\uC740 \uB370\uC774\uD130\uC758 \uACBD\uC6B0 \uBB38\uC11C \uBAA8\uB378\uC740 \uACE4\uB780\uD558\uACE0 \uAD00\uACC4\uD615 \uBAA8\uB378\uC740 \uBB34\uB09C\uD558\uBA70 \uADF8\uB798\uD504 \uBAA8\uB378\uC740 \uB9E4\uC6B0 \uC790\uC5F0\uC2A4\uB7FD\uB2E4.</p><h2 id="\u110B\u1169\u1102\u1173\u11AF\u110B\u1174-\u1100\u1169\u11BC\u1107\u116E-\u1112\u1161\u11AB\u1106\u1161\u1103\u1175" tabindex="-1"><a class="header-anchor" href="#\u110B\u1169\u1102\u1173\u11AF\u110B\u1174-\u1100\u1169\u11BC\u1107\u116E-\u1112\u1161\u11AB\u1106\u1161\u1103\u1175" aria-hidden="true">#</a> \uC624\uB298\uC758 \uACF5\uBD80 \uD55C\uB9C8\uB514</h2><ul><li>\uC815\uB9D0 \uB9CE\uC740 \uB0B4\uC6A9\uC774 \uC788\uC5C8\uC9C0\uB9CC \uC18C\uD654\uD560 \uC218 \uC788\uC744 \uB9CC\uD07C\uB9CC \uAE30\uB85D\uD588\uB2E4 \uB098\uC911\uC5D0 \uB2E4\uC2DC \uBCF4\uBA74 \uB354 \uB9CE\uC774 \uC774\uD574\uD560 \uC218 \uC788\uACA0\uC9C0</li></ul>',35),t=[r];function n(d,p){return i(),a("div",null,t)}var h=l(o,[["render",n],["__file","ch2-data-models.html.vue"]]);export{h as default};
